import React, {useState} from 'react'
import Viagens from './Viagens'
import Login from '../AreaRestrita/Login'
import InscrevaSe from './IncreverSe'
import Home from './components/AreaPublica/Home'

export default function App() {
  const [tela, setTela] = useState("viagens")

  const mudaTela = () => {
    switch (tela) {
        case "home" :
            return <Home vaiParaHome={vaiParaHome}/>
            case "increvaSe" :
                return <InscrevaSe vaiParaInscrevaSe={vaiParaInscrevaSe}/>    
        case "viagens" :
            return <Viagens vaiParaViagens={vaiParaViagens}/>
        case "login" : 
            return <Login vaiParaLogin={vaiParaLogin}/>
        default: 
            return <>Erro! Página não encontrada!⚠️</>       
    }
}

const vaiParaViagens = () => {
    setTela("viagens")
}

const vaiParaLogin = () => {
    setTela("login")
}

const vaiParaHome = () => {
    setTela("home")
}

const vaiParaInscrevaSe = () => {
    setTela("inscrevaSe")
}


  return (
    <div>
      {mudaTela()}
    </div>
  )
}
